defmodule IsomorphicStrings205Test do
  @moduledoc """
  Tests for isomorphic strings.
  """
  use ExUnit.Case
  alias IsomorphicStrings205

  test "Case 1" do
    s = "egg"
    t = "add"

    assert IsomorphicStrings205.is_isomorphic(s, t) == true
  end

  test "Case 2" do
    s = "foo"
    t = "bar"

    assert IsomorphicStrings205.is_isomorphic(s, t) == false
  end

  test "Case 3" do
    s = "paper"
    t = "title"

    assert IsomorphicStrings205.is_isomorphic(s, t) == true
  end

  test "Case 34" do
    s = "badc"
    t = "baba"

    assert IsomorphicStrings205.is_isomorphic(s, t) == false
  end

